import React from 'react';
import './App.css';
import { Link, NavLink } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <div className="nav-bar">
            <NavLink to="/">
                Home
            </NavLink>
            <NavLink to="/vocab">
                Vocabulary
            </NavLink>
            <NavLink to="/">
                COMING SOON
            </NavLink>
            <NavLink to="/">
                COMING SOON
            </NavLink>
        </div>
    );
}
export default Nav;
